import React, { ReactElement } from "react";

const Blocks = (props: { text: string }): ReactElement => {
  return (
    <>
      <div style={{ height: "1em", width: "4em", backgroundColor: "blue" }}>
        {props.text}
      </div>
    </>
  );
}

export default Blocks;
